import {Panel} from "rsuite";

const Home = () => {

  const imgStyles = {
      height: "10rem",
      width: "100%"
  }

  return (
    <div style={{
        padding: "1.3rem"
    }}>
      <div className="leftSide">
        <Panel shaded bordered bodyFill style={{
            display: 'inline-block',
            width: "100%",
        }}>
            <img style={imgStyles} src="https://via.placeholder.com/500"/>
            <Panel header="Username">

            </Panel>
        </Panel>
      </div>
      <div className="rightside">

      </div>
    </div>
  );
};

export default Home;
